import React, {Component} from 'react';
import Contacts from './Cinemaworld.js'

class App extends Component {
    render() {
        return (
            <Contacts IDs={this.state.IDs} />
          //   <div class="card">
          //   <div class="card-body">
          //     <h5 class="card-title">Steve Jobs</h5>
          //     <h6 class="card-subtitle mb-2 text-muted">steve@apple.com</h6>
          //     <p class="card-text">Stay Hungry, Stay Foolish</p>
          //   </div>
          // </div>
        )
    }

    state = {
        cinemaWorld: [],
        filmworld: [],
        IDs: []
    };

    componentDidMount() {
        fetch('https://challenge.lexicondigital.com.au/api/cinemaworld/movies/', {headers: {'x-api-key': 'Yr2636E6BTD3UCdleMkf7UEdqKnd9n361TQL9An7' }})
            .then(res => res.json())
            .then((data) => {

                this.setState({ cinemaWorld: data.Moviess })
            })
            fetch('https://challenge.lexicondigital.com.au/api/filmworld/movies/', {headers: {'x-api-key': 'Yr2636E6BTD3UCdleMkf7UEdqKnd9n361TQL9An7' }})
            .then(res => res.json())
            .then((data) => {
                let tmpArray = []
                for (var i = 0; i < data.Movies.length; i++){
                  tmpArray.push(data.Movies[i])
                }
                this.setState({ IDs: tmpArray})

            })

            .catch(console.log)
    }
}

export default App;
